import { prisma } from './../../../../prisma/generated/prisma-client';

export default {
  Mutation: {
    updateOpeningHours: async(_, args, request) => {



        const { cafename, dayOfTheWeek, open, close } = args;

        try {
            const cafe = await prisma.cafe({cafename});
            if (!cafe) {
              return false;
            }
            // Busy 데이터 있는지 체크
            const existingOpeningHours = await prisma.$exists.busy({
                dayOfTheWeek
            });

            if (existingOpeningHours) {
              return false;
            }

            const openingHours = await prisma.createOpeningHours({
                cafe: { connect: {id: cafe.id} },
                dayOfTheWeek,
                open,
                close
            });

            return true;
          } catch (e) {
            console.log(e);
            return false;
          }
    }
  }
}

